INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('50',2,'Kebun Teh Sidamanik','SIDAMANIK','<p><span style="color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;">Salah satu wilayah di Kabupaten Simalungun, Sumatera Utara yang layak menjadi pilihan kunjungan wisata terutama di saat liburan seperti Tahun Baru adalah Kecamatan Sidamanik. Di kecamatan ini, objek wisata alam menjadi primadona. Kondisi alam di sana terbilang masih asri dan asli. Terlebih ruas jalan menuju kecamatan ini, dari Pematangsiantar cukup mulus dengan aspal hitam, disuguhkan pemandangan sawah di kiri kanan. Tak lebih satu jam berkendara, pengunjung bisa sampai di sana, terutama di ibukota kecamatan. Pengunjung punya pilihan untuk menikmati panorama alam.</span><span style="font-family: &quot;Source Sans Pro&quot;;">ï»¿</span><br></p>','Salah satu wilayah di Kabupaten Simalungun, Sumatera Utara yang layak menjadi pilihan kunjungan wisata terutama di saat liburan seperti Tahun Baru adalah Kecamatan Sidamanik. Di kecamatan ini, objek w...','kebun-teh-sidamanik','tourism-place/1661313779-sidamanik-banner.png','(+62) ___-____-____','2.978161',99278558,420,8439,'2022-10-19','2022-10-01',0);
