INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('97',2,'Museum Simalungun','SIANTAR','<p><font color="#000000"><b style="font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">Museum Simalungun</b><span style="font-family: sans-serif; font-size: 14px;">&nbsp;adalah sebuah&nbsp;</span><a href="https://id.wikipedia.org/wiki/Museum" title="Museum" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;"><font color="#000000">museum</font></a><span style="font-family: sans-serif; font-size: 14px;">&nbsp;daerah yang berada di Jalan Sudirman Nomor 20, Kelurahan&nbsp;</span><a href="https://id.wikipedia.org/wiki/Proklamasi,_Siantar_Barat,_Pematangsiantar" title="Proklamasi, Siantar Barat, Pematangsiantar" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;"><font color="#000000">Proklamasi</font></a><span style="font-family: sans-serif; font-size: 14px;">, Kecamatan&nbsp;</span><font color="#000000"><a href="https://id.wikipedia.org/wiki/Siantar_Barat,_Pematangsiantar" title="Siantar Barat, Pematangsiantar" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">Siantar Barat</a><span style="font-family: sans-serif; font-size: 14px;">,&nbsp;</span></font><a href="https://id.wikipedia.org/wiki/Kota_Pematangsiantar" title="Kota Pematangsiantar" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;"><font color="#000000">Kota Pematangsianta</font>r</a><span style="font-family: sans-serif; font-size: 14px;">, Provinsi&nbsp;</span><a href="https://id.wikipedia.org/wiki/Sumatra_Utara" title="Sumatra Utara" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">Sumatera Utara</a><span style="font-family: sans-serif; font-size: 14px;">. Museum ini mulai dibangun pada bulan April tahun 1939 dan selesai dibangun pada bulan Desember pada tahun yang sama. Pembangunan museum bertujuan untuk melestarikan budaya&nbsp;</span><a href="https://id.wikipedia.org/wiki/Suku_Simalungun" title="Suku Simalungun" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">Batak Simalungun</a><span style="font-family: sans-serif; font-size: 14px;">&nbsp;seperti benda-benda&nbsp;</span><a href="https://id.wikipedia.org/wiki/Cagar_budaya" title="Cagar budaya" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">cagar budaya</a><span style="font-family: sans-serif; font-size: 14px;">&nbsp;yang bernilai&nbsp;</span><a href="https://id.wikipedia.org/wiki/Sejarah" title="Sejarah" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">sejarah</a><span style="font-family: sans-serif; font-size: 14px;">. Museum Simalungun dan koleksinya dianggap sebagai upaya pelestarian peninggalan sejarah dari&nbsp;</span><a href="https://id.wikipedia.org/w/index.php?title=Kerajaan_Marpitu&amp;action=edit&amp;redlink=1" class="new" title="Kerajaan Marpitu (halaman belum tersedia)" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">Kerajaan Marpitu</a><span style="font-family: sans-serif; font-size: 14px;">&nbsp;yang menjadi bagian dari sejarah Simalungun. Museum Simalungun dikelola oleh Yayasan Museum Simalungun yang didirikan pada tanggal 27 September 1954 sesuai dengan&nbsp;</span><a href="https://id.wikipedia.org/wiki/Akta_Notaris" title="Akta Notaris" style="background: none rgb(255, 255, 255); font-family: sans-serif; font-size: 14px; animation-delay: -0.01ms !important; animation-duration: 0.01ms !important; animation-iteration-count: 1 !important; scroll-behavior: auto !important; transition-duration: 0ms !important;">akta notaris</a><span style="font-family: sans-serif; font-size: 14px;">&nbsp;nomor 13 tahun 1954</span></font><br></p>','Museum Simalungun&nbsp;adalah sebuah&nbsp;museum&nbsp;daerah yang berada di Jalan Sudirman Nomor 20, Kelurahan&nbsp;Proklamasi, Kecamatan&nbsp;Siantar Barat,&nbsp;Kot