INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('122',2,'Air Terjun Tonduhan','Tonduhan, Simalungun, North Sumatra, 21181, Indonesia','<p>Air Terjun yang memiliki ketinggian 80 meter ini selalu membius mata wisatawan yang datang berkunjung ke tempat ini. Dipuncak air terjun terdapat sebuah batu besar yang menonjol, akibatnya jatuhan air terjunnya terbagi menjadi dua. Dibawah jatuhan air terjunnya juga terbentuk sebuah kolam yang cukup luas dan dalam, airnya dingin dan segar.</p>','Air Terjun yang memiliki ketinggian 80 meter ini selalu membius mata wisatawan yang datang berkunjung ke tempat ini. Dipuncak air terjun terdapat sebuah batu besar yang menonjol, akibatnya jatuhan air...','air-terjun-tonduhan','tourism-place/1663045453-air-terjun-hatonduhan-banner.png','(+62) 821-6502-5615','2.978161',99278558,423,8488,'2022-12-30','2022-10-03',0);
INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('123',2,'Air Terjun Katasa','Buntu Bayu, Simalungun, North Sumatra, Indonesia','<p>&nbsp;Air Terjun ini memiliki keindahan alam yang masih natural dan keasrian tempatnya masih terjaga. Nuansa alami, hawa sejuk serta udara segar dapat dirasakan disini. Air Terjun Katasa sering disebut sebagai Air Terjun Kembar, karena air terjun ini mempuyai 2 aliran air terjun, aliran tersebut berasal dari 2 sungai yaitu, Sungai Turunan dan Sungai Balah. Kedua aliran tersebut berada di tempat yang sama, keunikannya berada di kedua alirannya yang tidak menyatu karena terpisah beberapa meter.</p><p>Keunikan lain dari Air Terjun Katasa adalah keberadaan pulau pasir yang berada di dekat kolam air terjun. Tempat ini juga menjadi salah satu tempat favorit untuk bersantai menikmati keasrian alamnya. Terdapat goa kecil di sebelah kiri air terjun ini, goa tersebut lantainya berlapis putih lembut. </p><p>Selain goa, terdapat juga jembatan di atas Air Terjun Katasa. Jembatan itu merupakan bekas rel kreta api yang dicor beton dari jaman penjajahan Jepang. Jembatan tersebut hanya memiliki panjang 100 meter, lebar 1 meter, dan tingginya 80 meter. Bukan ukurannya saja yang mini, tetapi di jembatan tersebut tidak ada pagar pengaman di kanan-kiri jembatan.</p>','&nbsp;Air Terjun ini memiliki keindahan alam yang masih natural dan keasrian tempatnya masih terjaga. Nuansa alami, hawa sejuk serta udara segar dapat dirasakan disini. Air Terjun Katasa sering disebu...','air-terjun-katasa','tourism-place/1663046324-air-terjun-katasa-banner.png','(+62) 821-6502-5615','2.978161',99278558,423,8482,'2022-12-31','2022-10-03',0);
