INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('216',1,'GUA BABA LIANG','Haranggaol, Simalungun, North Sumatra, Indonesia','<p><span style="font-size: 15px; color: rgb(101, 101, 101); font-family: &quot;Source Sans Pro&quot;;">Gua Baba Liang ini berada di perbatasan Desa Salbe, tepatnya di Desa Huta Liang Atas Nagori Pasir Batu, Kecamatan Haranggaol Horison, Kabupaten Simalungun, Sumatera Utara. Daerah ini sekitar 10 km dari Pelabuhan Tigaras. Gua Baba Liang ini cukup istimewa, karna Gua Baba Liang ini memiliki lorong yang banyak unuk memasuki gua, dan dibagian sekitar gua juga banyak gua gua kecil yang indah dan menarik pastinya untuk dinikmati sebagai penghibur mata.</span></p><p><span style="font-size: 15px; color: rgb(101, 101, 101); font-family: &quot;Source Sans Pro&quot;;">Selain keindahan dari tempat ini, Gua Baba Liang ini juga memiliki cerita tersendiri pada zaman dulu dikatakan bahwa Gua Baba Liang dapat dijalani tembus dari Haranggaol ke Pematang Raya. Liburan ke Gua Baba Liang ini pasti menambah pengalaman bagi sebagian pengunjung wisatawan. Wisata yang paling sering kita datangi seperti mendaki, liburan santai ataupun wisata bahari , tentu tempat berbaur sedikit extreme bisa menjadi pengalaman baru bagi sebagian wisatawan.</span></p><p><br></p>','Gua Baba Liang ini berada di perbatasan Desa Salbe, tepatnya di Desa Huta Liang Atas Nagori Pasir Batu, Kecamatan Haranggaol Horison, Kabupaten Simalungun, Sumatera Utara. Daerah ini sekitar 10 km dar...','gua-baba-liang','tourism-place/1663041926-gua-baba-liang-tourism-place.png','(+62) 821-6821-1323','2.978161',99278558,426,8520,'2022-09-13','2022-10-03',0);
