INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('223',1,'Makam Raja Silimahuta','Ujung Saribu, Simalungun, North Sumatra, Indonesia','<p>Kerajaan Silimahuta merupakan kerajaan paling muda di Simalungun, ini diakui oleh Belanda sejak tahun 1907 saat tuan Pamoraidup menandatangani pernyataan tunduk kepada Belanda. Kerajaan Siimahuta terdiri dari&nbsp; 5 kampung yaitu Rakut Besi, Dolok Panribuan, Saribu Jandi, Mardinding, dan Naga Mariah.</p><p>Di sekeliling makam terdapat pilar pilar beton yang kemungkinan berfungsi sebagai pagar, pada bagian depan Makam terdapat Prasasti yang bertuliskan huruf latin. Wilayah Kerajaan Silimahuta pada awalnya berada dibawah kekuasaan Dolok Silou marga Purba Tambak, dan penduduknya merupakan campuran antara Karo, Pak-pak, Toba, dan Simalungun.</p>','Kerajaan Silimahuta merupakan kerajaan paling muda di Simalungun, ini diakui oleh Belanda sejak tahun 1907 saat tuan Pamoraidup menandatangani pernyataan tunduk kepada Belanda. Kerajaan Siimahuta terd...','makam-raja-silimahuta','tourism-place/1663044818-makam-raja-silimahuta-tourism-place.png','(+62) 813-7529-7582','2.978161',99278558,442,8716,'2022-09-13','2022-10-03',0);
