INSERT INTO tourisms(id,category_id,name,address,description,excerpt,slug,image,phone,latitude,longitude,district_id,village_id,created_at,updated_at,is_recomended) VALUES ('225',1,'Bah Silulu','Gunung Malela','<p>Pemandian Bah Silulu merupakan Wisata air yang mengapresiasikan antara kolam renang modern, dengan pemandangan alam yang masih asri karena disampingnya terlihat kawasan hutan yang masih asri. Tempat ini aman dan nyaman untuk liburan keluarga. Pemandian bernuansa alam ini begitu menyejukkan mata, esegarannya akan sangat terasa tatkala digunakan untuk berenang karena bersumber dari mata air mineral.<br></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;">Sambil menikmati alam Gunung Maligas yang udaranya cukup dingin, pengunjung bisa berendam di atas mata air sekaligus merasakan lembutnya pijatan relaksasi alam. Destinasi alam ini juga banyak dikunjungi keluarga ka<span style="font-size: 1rem;">rena tersedia spot khusus permainan anak.</span></p>','Pemandian Bah Silulu merupakan Wisata air yang mengapresiasikan antara kolam renang modern, dengan pemandangan alam yang masih asri karena disampingnya terlihat kawasan hutan yang masih asri. Tempat i...','bah-silulu','tourism-place/1663047641-bah-silulu-tourism-place.png','(+62) 813-9678-6644','2.978161',992